//+----------------------------------------------------------------------+
//|                                              Demo_traill_Sell_v1.mq4 |
//|             Demo application                       2011,autor,Genkov |
//|          for trailing Sell position         genkov@bk.ru,kovgd@ya.ru |
//|            The application works                                     |
//|  in time interval from 2011.10.28 to 2011.11.02                      |
//+----------------------------------------------------------------------+
#property copyright "2011,autor,Genkov"
#property link      "http://ForexkovTrade.com"
#property link      "http://Fxkom.narod.ru"
#property link      "http://forexparter.ucoz.ru/"
#property link      "http://forexmql.narod.ru/Runet.htm"
#property link      "http://forexchainik.narod.ru/"
#property link      "http://Animatyc.narod.ru" 
#property link      "http://genkov.baxonet.biz/"
#property link      "genkov@bk.ru , kovgd@ya.ru"
//+----------------------------------------------------------------------+
extern double SL_S=0;
extern double TP_S=0;
extern double Lots=0.1;
int Magic,i,d;
double Fb1,Fb2,Fb3,Fb4,Fb5,Fb6,Fb7,Fb8,Fb9,Fb10,Fb11,Fb12,Fb13;
double MedVegas,newSL_S,Ma144_1,Ma169_1;
//+------------------------------------------------------------------+
//|                                                                  |
//+------------------------------------------------------------------+
void Mark()
  {
   ObjectCreate("Mk"+d,OBJ_ARROW,0,TimeCurrent(),newSL_S);
   ObjectSet("Mk"+d,OBJPROP_COLOR,Aqua);ObjectSet("Mk"+d,OBJPROP_ARROWCODE,4);
  }
//+------------------------------------------------------------------+
//|                                                                  |
//+------------------------------------------------------------------+
void MarkLeft2()
  {
   ObjectCreate("Md"+d,OBJ_ARROW,0,TimeCurrent(),Ask);
   ObjectSet("Md"+d,OBJPROP_COLOR,Aqua);ObjectSet("Md"+d,OBJPROP_ARROWCODE,6);
  }
//+------------------------------------------------------------------+
//|                                                                  |
//+------------------------------------------------------------------+
void Op_Sell_Ch()
  {
   if(!OrderSend(Symbol(),OP_SELL,Lots,Bid,2,Ask+SL_S*Point,Bid-TP_S*Point," ",Magic,0,Red))
     {Print("  SELL order opening error  # ",GetLastError());}return(0);
  }
//+------------------------------------------------------------------+
//|                                                                  |
//+------------------------------------------------------------------+
void Modyf_S_lot()
  {
   if(!OrderModify(OrderTicket(),OrderOpenPrice(),newSL_S,
      OrderTakeProfit(),0,Aqua))
     {
      Print(" Modif.ord.# ",OrderTicket(),
            " Error # ",GetLastError());
     }
   Mark();return;
  }
// ----------------------------------------------------------------------+
void SL_Sell_fromH1()
  {
   double Fb1,Fb2,Fb3,Fb4,Fb5,Fb6,Fb7,Fb8,Fb9,Fb10,Fb11,Fb12,Fb13;
   double Ma144_1 = iMA(NULL,0,144,0,MODE_EMA,PRICE_CLOSE,1);
   double Ma169_1 = iMA(NULL,0,169,0,MODE_EMA,PRICE_CLOSE,1);
   double MedVegas=NormalizeDouble((Ma144_1+Ma169_1)/2,Digits);
   Fb1=MedVegas-377*Point;     Fb12=MedVegas+377*Point;
   Fb2=MedVegas-233*Point;     Fb11=MedVegas+233*Point;
   Fb3=MedVegas-144*Point;     Fb10=MedVegas+144*Point;
   Fb4=MedVegas-89*Point;      Fb9=MedVegas+89*Point;
   Fb5=MedVegas-55*Point;      Fb8=MedVegas+55*Point;
   Fb6=MedVegas-34*Point;      Fb7=MedVegas+34*Point;
   if(High[1]<=Fb12 && High[1]>(Fb12+Fb11)/2)        newSL_S=Fb12+100*Point;
   if(High[1]<=Fb12 && High[1]>Fb11)                 newSL_S=Fb12;
   if(High[1]<=Fb11 && High[1]>Fb11+Fb10)            newSL_S=Fb11;
   if(High[1]<=Fb10 && High[1]>(Fb10+Fb9)/2)         newSL_S=(Fb11+Fb10)/2;
   if(High[1]<=Fb9  && High[1]>Fb8)                  newSL_S=(Fb10+Fb9)/2;
   if(High[1]<=Fb8  && High[1]>Fb7)                  newSL_S=Fb9;
   if(High[1]<=Fb7  && High[1]>MedVegas)             newSL_S=Fb8;
   if(High[1]<=MedVegas && High[1]>MedVegas)         newSL_S=Fb7;
   if(High[1]<=(MedVegas+Fb6)/2 && High[1]>Fb6)      newSL_S=MedVegas;
   if(High[1]<=Fb6  && High[1]>Fb5)                  newSL_S=MedVegas;
   if(High[1]<=Fb5  && High[1]>Fb4)                  newSL_S=Fb6;
   if(High[1]<=Fb4  && High[1]>Fb3)                  newSL_S=Fb5;
   if(High[1]<=Fb3  && High[1]>Fb2)                  newSL_S=Fb4;
   if(High[1]<=Fb2  && High[1]>(Fb2+Fb1)/2)          newSL_S=(Fb2+Fb3)/2;
   if(High[1]<(Fb2+Fb1)/2   && High[1]>Fb1)          newSL_S=Fb2;
   if(High[1]<Fb1)                                   newSL_S=(Fb2+Fb1)/2;
  }
//+----------------------------------------------------------------------+
int start()
  {
   if(TimeCurrent()<StrToTime("2011.10.28"))   return;
     {
      if(TimeCurrent()>StrToTime("2011.11.02"))  return;
        {
         int StopLevel=MarketInfo(Symbol(),MODE_STOPLEVEL);
         d=TimeCurrent();
         if(Volume[0]>1)return;{if(Bid>1.4184 && Bid<=1.4186)
           {
            Lots=0.2;
            SL_S=(High[1]-Bid)/Point+55;if(SL_S<=StopLevel)SL_S=StopLevel+5;
            TP_S=550;MarkLeft2();Op_Sell_Ch();Lots=0.1;
           }
        }
      // ======================================================================+
      //           ------------ TRAILING OPEN POSITIONS  ------------
      // ----------------------------------------------------------------------+
      for(int i=OrdersTotal()-1; i>=0; i--)
        {
         if(!OrderSelect(i,SELECT_BY_POS,MODE_TRADES))
           {Print("Order selection error = ",GetLastError());}
         if(OrderSymbol()==Symbol())
           {
            if(OrderType()==OP_SELL)
              {
               if(OrderMagicNumber()==Magic)
                 {
                  if((OrderOpenPrice()-Low[1])>=SL_S*Point && OrderLots()==0.2)
                    {
                     if(!OrderClose(OrderTicket(),0.1,Ask,2,Aqua))
                       {Print(" Cl.ord.# ",OrderTicket()," Error # ",GetLastError());}
                     MarkLeft2();return(0);
                    }
                  // ----------------------------------------------------------------------+
                  if((OrderOpenPrice()-Low[1])>=100*Point && OrderLots()==0.1 && OrderStopLoss()>OrderOpenPrice())
                    {
                     if(!OrderModify(OrderTicket(),OrderOpenPrice(),OrderOpenPrice()-2*Point,OrderTakeProfit(),0,Aqua))
                       {Print(" Modif.ord.# ",OrderTicket()," Error # ",GetLastError());}
                    }
                  // -----------------------------------------------------------------------+
                  if((OrderOpenPrice()-Low[1])>=150*Point && OrderLots()==0.1 && (OrderOpenPrice()-Low[1])<200*Point)
                    {SL_Sell_fromH1();if(newSL_S<OrderStopLoss() && (newSL_S-Bid)/Point>StopLevel)
                       {
                        Print(" 2nd stage at 150 pip - StopLoss shift by level order # ",OrderTicket());
                        Modyf_S_lot();
                       }
                    }
                  // -----------------------------------------------------------------------+
                  if((OrderOpenPrice()-Low[1])>=200*Point && (OrderOpenPrice()-Low[1])<300*Point)
                    {SL_Sell_fromH1();if(newSL_S<OrderStopLoss() && (newSL_S-Bid)/Point>StopLevel)
                       {
                        Print(" 3rd StopLoss shift");Modyf_S_lot();
                       }
                    }
                  // -----------------------------------------------------------------------+
                  if((OrderOpenPrice()-Low[1])>=300*Point && (OrderOpenPrice()-Low[1])<=500*Point)
                    {SL_Sell_fromH1();if(newSL_S<OrderStopLoss() && (newSL_S-Bid)/Point>StopLevel)
                       {
                        Print(" 4th StopLoss shift by level ");Modyf_S_lot();
                       }
                    }
                  // -----------------------------------------------------------------------+
                  if((OrderOpenPrice()-Low[1])>=500*Point)
                    {
                     SL_Sell_fromH1();
                     if(newSL_S-21*Point<OrderStopLoss() && ((newSL_S-21*Point)-Bid)/Point>StopLevel)
                       {newSL_S=newSL_S-21*Point;Print(" 5th StopLoss shift ");Modyf_S_lot();}
                    }
                  // -----------------------------------------------------------------------+
                  if((OrderOpenPrice()-Low[1])>=500*Point)
                    {
                     SL_Sell_fromH1();
                     if(newSL_S-13*Point<OrderStopLoss() && ((newSL_S-13*Point)-Bid)/Point>StopLevel)
                       {newSL_S=newSL_S-13*Point;Print(" 6th StopLoss shift");Modyf_S_lot();}
                    }
                  // ------------------------------------------------------------------------+
                 }
              }
           }
        }
     }
  }
return(0);
}
//+----------------------------------------------------------------------+------------------------------+

