//===========================================================================
#property library
#define PREFIX "_NLR_Mix_"
//===========================================================================
void Create_NLR(color& _Color[], double _NLR_Deviation_Fibo_Coef, double _Stop_Loss_Fibo_Coef, int _NLR_Period,
     int _NLR_Regression_Degree, bool _R_Z, bool _Stop_Loss_Is_Visible, bool _R_L, double& Support[], double& Resist[]) {

   string str = StringConcatenate(PREFIX, Time[_NLR_Period], _NLR_Period);
   int i,j,p,kt,te,te1,n,nn,k,z,trend;
   double fx,fx1,a[10,10],b[10],x[10],sx[20],sum,sum1,std,sq1,sq2,sq3,value,price;
   color _Border =  Silver; color _Alert =   0x000030; color _Warning = 0x300000;
   kt=Period()*60; p=_NLR_Period; sx[1]=p+1; nn=_NLR_Regression_Degree+1;
   for(i=1; i<=nn*2-2; i++) { sum=0.0; for(n=0; n<=p; n++) sum+=MathPow(n,i); sx[i+1]=sum; }
   for(i=1; i<=nn; i++) {sum=0.0; for(n=0; n<=p; n++) {if(i==1) sum+=Close[n]; else sum+=Close[n]*MathPow(n,i-1);} b[i]=sum;}
   for(j=1; j<=nn; j++) {for(i=1; i<=nn; i++) {k=i+j-1; a[i,j]=sx[k];}}
   af_Gauss(nn,a,b,x); std=0.0;
   for (n=p; n>=0; n--) {
      sum=0.0; for(k=1; k<=_NLR_Regression_Degree; k++) {sum+=x[k+1]*MathPow(n,k);} fx=x[1]+sum; std+=MathPow(Close[n]-fx,2);
   }
   std=MathSqrt(std/(p+1));

   if ( _Stop_Loss_Is_Visible ) {
      ArrayInitialize(Support,0); ArrayInitialize(Resist,0);
      for(z = p; z > 0; z--) {
         if (trend > 0) {
            if (Close[z] > price) price = Close[z];
            value = price - _Stop_Loss_Fibo_Coef * std;
            if (Close[z] < value) {
               price = Close[z];
               value = price + _Stop_Loss_Fibo_Coef * std;
               trend = -1;
            }
         } else {
            if (Close[z] < price) price = Close[z];
            value = price + _Stop_Loss_Fibo_Coef * std;
            if (Close[z] > value) {
               price = Close[z];
               value = price - _Stop_Loss_Fibo_Coef * std;
               trend = 1;
            }
         }
