void af_Gauss(int n, double& a[][],double& b[], double& x[]) {
  int i,j,k,l;
  double q,m,t;
  for(k=1; k<=n-1; k++) {
    l=0; 
    m=0; 
    for(i=k; i<=n; i++) {if (MathAbs(a[i,k])>m) {m=MathAbs(a[i,k]); l=i;}}
    if (l==0) return;
    if (l!=k) {for(j=1; j<=n; j++) {t=a[k,j]; a[k,j]=a[l,j]; a[l,j]=t;} t=b[k]; b[k]=b[l]; b[l]=t;}
    for(i=k+1;i<=n;i++) {q=a[i,k]/a[k,k]; for(j=1;j<=n;j++) {if (j==k) a[i,j]=0; else a[i,j]=a[i,j]-q*a[k,j];}
    b[i]=b[i]-q*b[k];}
  }  
  x[n]=b[n]/a[n,n]; 
  for(i=n-1;i>=1;i--) {t=0; for(j=1;j<=n-i;j++) {t=t+a[i,i+j]*x[i+j]; x[i]=(1/a[i,i])*(b[i]-t);}}
}
